  buttonText: string;
  setFormCardHeightClass: string;
  showSpinner: boolean;
  subs$ = new Subject();
  commitsResponse: any;
  repository: string;
  cacheCommits = new Map<string, string>();
  cacheRepositories = new Map<string, string>();
